import React from 'react';
import classes from './DisplayWork.module.scss';

const displayWork = (props) => {
    return(
        <div>
            {props.projects.map((projects, index) => 
                <div>
                    <h1>{projects.name}</h1>
                    <p>{projects.desc}</p>
                </div>
            )}
        </div>
    );
};

export default displayWork;
